import React from 'react';
import {Link} from 'react-router-dom';



const Navbar = () => {
  return (
    <nav className="flex items-center justify-between flex-wrap text-white bg-neutral-focus py-4 px-8">
        <div className='font-semibold'>
            Breaking Bad
        </div>
        <div>
            <Link to='/' className='btn btn-ghost btn-md mr-1 hover:bg-blue-700'>
                Home
            </Link>
            <Link to='/acteurs' className='btn btn-ghost btn-md hover:bg-blue-700'>
                Acteurs
            </Link>
        </div>
        
    </nav>
  )
}

export default Navbar
